import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import CarTableRow from './CarTableRow';
export default class CarTable extends Component 
{
   constructor(props) 
  {
    super(props)
    this.state = {
         cars: []
         };


     axios.get('http://localhost:4000/toyota/')
      .then(res => {
        this.setState({
          cars: res.data
        }); 
      })
      .catch((error) => console.log(error))

  }

    render() {
        return (
                <table>
        <thead>
          <tr>
            <th>Model</th>
            <th>Colour</th>
            <th>Year</th>
            <th>Price</th>
            <th>&nbsp;</th>
          </tr>
        </thead>
        <tbody>
        {this.props.cars.map((car) => <CarTableRow obj={car}/>)}
        </tbody>
      </table>


        );
    }
}
